Let the two numbers be $x$ and $y$, with $x>y$. We wish to find $x$ and $y$. We can set up a system of two equations to represent the given information. The equations are:

\begin{align*}
x+y&=64\\
x-y&=4
\end{align*}

We wish to find $x$, which is the larger number. Adding the two equations, we obtain $2x=68$, so $x=34$. Therefore, the larger number is $\boxed{34}$. The answer is 34

The formula for the mass percentage of O is given by: \begin{align*}
\frac{m_O}{m_O + m_{C4H8}} \times 100\%
\end{align*} We calculate the mass of O in the compound by multiplying the number of O atoms in the formula by the mass of one O atom: \begin{align*}
m_O &= 2 \times \frac{16}{1000} = \frac{32}{1000} \\
\end{align*} We do the same for the mass of C4H8: \begin{align*}
m_{C4H8} &= 4 \times \frac{12}{1000} + 8 \times \frac{1}{1000} = \frac{64}{1000} + \frac{8}{1000} = \frac{72}{1000} \\
\end{align*} So the mass percentage of O is: \begin{align*}
\frac{32/1000}{32/1000 + 72/1000} \times 100\% &= \frac{32}{1000 + 72} \times 100\%\\
&= \frac{32}{172} \times 100\% = \boxed{18.28\%}
\end{align*}. The answer is 18.28
